// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity 0.8.17;
pragma abicoder v2;

import '@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol';
import '@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol';
import '@uniswap/v3-periphery/contracts/interfaces/IQuoter.sol';


contract TransferSwap {

     address public constant routerAddress = 0xE592427A0AEce92De3Edee1F18E0157C05861564;
    ISwapRouter public immutable swapRouter = ISwapRouter(routerAddress);
    IQuoter public constant quoter = IQuoter(0xb27308f9F90D607463bb33eA1BeBb41C27CE5AB6);


    address public constant puni =  0x1a0bb9499D633B36a1d88F3F3Da763d276f903B6;
    address public constant vky = 0xA673a9cc54466Dc36Be3cadB1EfD1b3BfC716BFE;


    uint24 public constant poolFee = 10000;

    function getEstimated(uint puniAmount) external returns (uint256) {
     address tokenIn = puni;
     address tokenOut = vky;
     uint24 fee = poolFee;
     uint160 sqrtPriceLimitX96 = 0;

     return quoter.quoteExactInputSingle(
         tokenIn,
         tokenOut,
         fee,
         puniAmount,
         sqrtPriceLimitX96
      );
    }



    function swapExactInputSingle(uint256 amountIn) external returns (uint256 amountOut) {

        TransferHelper.safeTransferFrom(puni, msg.sender, address(this), amountIn);


        TransferHelper.safeApprove(puni, address(swapRouter), amountIn);


        ISwapRouter.ExactInputSingleParams memory params =
            ISwapRouter.ExactInputSingleParams({
                tokenIn: puni,
                tokenOut: vky,
                fee: poolFee,
                recipient: msg.sender,
                deadline: block.timestamp,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            });

        // The call to `exactInputSingle` executes the swap.
        amountOut = swapRouter.exactInputSingle(params);
    }


    function swapExactOutputSingle(uint256 amountOut, uint256 amountInMaximum) external returns (uint256 amountIn) {

        TransferHelper.safeTransferFrom(puni, msg.sender, address(this), amountInMaximum);

        // In production, you should choose the maximum amount to spend based on oracles or other data sources to acheive a better swap.
        TransferHelper.safeApprove(puni, address(swapRouter), amountInMaximum);

        ISwapRouter.ExactOutputSingleParams memory params =
            ISwapRouter.ExactOutputSingleParams({
                tokenIn: puni,
                tokenOut: vky,
                fee: poolFee,
                recipient: msg.sender,
                deadline: block.timestamp,
                amountOut: amountOut,
                amountInMaximum: amountInMaximum,
                sqrtPriceLimitX96: 0
            });

        // Executes the swap returning the amountIn needed to spend to receive the desired amountOut.
        amountIn = swapRouter.exactOutputSingle(params);

        if (amountIn < amountInMaximum) {
            TransferHelper.safeApprove(puni, address(swapRouter), 0);
            TransferHelper.safeTransfer(puni, msg.sender, amountInMaximum - amountIn);
        }
    }
}
